Girls Of Summer {dd}: It`s a coming of age story as five gorgeous chicks meet every summer to let their horny selves loose! These hotties share a sisterhood that can`t be broken, but drama steeps in when Destiny Dixon conceals a naughty secret and bangs her friends ex-boyfriend! Ultimately, these girls overcome their issues to explore their bodies and sexuality. All five leave with an even bigger bond than before and add to their list of sexual conquests. Summer may come and go but these ladies will always be best friends for life!
